import React from 'react';
import {Link} from 'react-router-dom';

const AboutMe = () =>(
<div className="about">
<h3>
    About me...
</h3>
<h5>Meet Rashmi, the baker, 
I'm Rashmi, an cheerful person loves baking, cooking and designing. I live in austin, Texas with my husband and son. <br/>
I have a passion on baking amazing stuffs.My other interest include painting,arts and crafts.



Thank you for your time. Have a nice day!</h5>
<Link to="/"><a href="#">Go Home</a></Link>
</div>

);
export default AboutMe;
